import { Row } from 'react-bootstrap';
import './App.css';
import bodyComponent from './component/bodyComponent';
import NavbarComponent from './component/NavbarComponent';

function App() {
  return (
    <div className="App">
      <NavbarComponent />
      <Row>
        <bodyComponent />
      </Row>
    </div>
  );
}

export default App;
